(function() {
  this.App || (this.App = {});

  App.cable = ActionCable.createConsumer();

}).call(this);
$(document).ready(function(){
  user_id = all_user_id();
  for (var i = 0; i < user_id.length; i++) {
    App.auction = App.cable.subscriptions.create(
      {
        channel: 'ChatRoomAdminsChannel',
        user_id: user_id[i],
      },
      {
        received: function(data) {
          data = data.obj;
          image_default = '/assets/no-avatar-4ace913041f8df740dfa0e760b1bf90a7e90f0ecc973cc86d5ed1c8799a469ae.png';
          image_admin = '/assets/avart-admin-01ecef1eec00559d671b50e3425beb5264f4090961ce2dcaca549414f672c84b.png'
          avatar = data.avatar.thumb.url
            ? data.avatar.thumb.url : image_default
          name = data.name;
          if (data.admin == 1) {
            avatar = image_admin;
            name = 'Qun tr vin';
          }
          html = '';
          html += '<li class="message">';
          html += '<div class="avatar">';
          html += '<img class="no-avatar" src="'+ avatar +'">';
          html += '</div>';
          html += '<div class="text_wrapper">';
          html += '<div class="text">'+ data.message +'</div>';
          html += '<div class="text_details">'+ data.datetime +'</div>';
          html += '<span class="name">'+ name +'</span>';
          html += '</div>';
          $('.message_template.admin').append(html);
          height = $('.message_template.admin').height();
          $('.messages.admin').animate({scrollTop: height});
          notify_messages.initOnLoad(data, avatar);
        }
      }
    );
  }

  function all_user_id() {
    user_id = null;
    $.ajax({
      url: '/admin/request_all_id_user',
      type: 'GET',
      contentType: 'application/json; charset=utf-8',
      dataType: 'JSON',
      async: false,
      success: function (response) {
        user_id = response;
      },
      error: function (err) {
        console.log(err);
      }
    });
    return user_id;
  }
});
var chart_data = {
	initOnLoad: function() {
		chart_data.set_data_chart();
		chart_data.request_order();
	},
	set_data_chart: function() {
		chars = chart_data.request_order().reverse();
		var lineChartData = {
			labels: ['Th 2', 'Th 3', 'Th 4', 'Th 5', 'Th 6', 'Th 7', 'Ch nht'],
			datasets: [{
				label: "My Second dataset",
				fillColor: "rgba(48, 164, 255, 0.2)",
				strokeColor: "rgba(48, 164, 255, 1)",
				pointColor: "rgba(48, 164, 255, 1)",
				pointStrokeColor: "#fff",
				pointHighlightFill: "#fff",
				pointHighlightStroke: "rgba(48, 164, 255, 1)",
				data: chars
			}]
		}
		chart_data.render_chart(lineChartData);
	},
	render_chart: function(lineChartData) {
		var chart = document.getElementById("line-chart")
		if (chart !== null) {
			chart = chart.getContext("2d");
			window.myLine = new Chart(chart).Line(lineChartData, {
				responsive: true
			});
		}
	},
	request_order: function(){
		charts = null
    $.ajax({
      url: '/admin/chart_order',
      type: 'GET',
      contentType: 'application/json; charset=utf-8',
      dataType: 'JSON',
      async: false,
      success: function (response) {
      	charts = response
      },
      error: function (err) {
        console.log(err);
      }
    });
    return charts;
	}
}

$(document).ready(function() {
	chart_data.initOnLoad();
});
